import React from 'react'
import {useLocation} from 'react-router-dom';
import { useState } from 'react';
import Axios from "axios";
import "./Dashboard.scss"
import {GiDuration, GiPoliceBadge} from "react-icons/gi"
import {TbCertificate} from "react-icons/tb"
import { jsPDF } from "jspdf";

function Dashboard() {
    const location = useLocation();
    const [profileImage, setprofileImage] = useState("");
    const [email,setemail] = useState("");
    const [phoneno,setphoneno] = useState("");
    const [bio,setbio] = useState("");
    const [id,setid]=useState("");
    const [c,setC]= useState([]);
    const [cpp,setCpp]= useState([]);
    const [java,setJava]= useState([]);
    const [python,setPython]= useState([]);
    const [cCerti,setCCerti]= useState([]);
    const [cppCerti,setCppCerti]= useState([]);
    const [javaCerti,setJavaCerti]= useState([]);
    const [pythonCerti,setPythonCerti]= useState([]);
    const [clink,setCLink]= useState("");
    const [cpplink,setCppLink]= useState("");
    const [javalink,setJavaLink]= useState("");
    const [pythonlink,setPythonLink]= useState("");
    const [subscription,setSubscription]= useState("");
    const [duration,setDuration]= useState("");
    const [end,setEnd]= useState("");

    Axios.post(`http://localhost:8000/getUserInfoAll`,{
        user: location.state.username
      }).then((res)=>
      {
        setprofileImage(res.data.pic);
        setemail(res.data.email);
        setphoneno(res.data.phone);
        setbio(res.data.bio);
        setid(res.data.id);  
        setC(res.data.c_points);
        setCLink(res.data.linkc) 
        setCppLink(res.data.linkcp) 
        setJavaLink(res.data.linkj) 
        setPythonLink(res.data.linkp) 
        setCpp(res.data.cpp_points);
        setJava(res.data.java_points);    
        setPython(res.data.python_points);     
        setCCerti(res.data.C_certificate);
        setCppCerti(res.data.Cpp_certificate);    
        setJavaCerti(res.data.Java_certificate);
        setPythonCerti(res.data.Python_certificate);    
        setSubscription(res.data.subscription);
        setDuration(res.data.duration);
        setEnd(res.data.end);
      })

    const Approve=(lang)=>{
        console.log("approve");
        var certi =''
                    
                    if(lang=="c")
                    {
                        var data=clink.trim().split(/\s+/);
                    }

                    if(lang=="cpp")
                    {
                        var data=cpplink.trim().split(/\s+/);
                    }

                    if(lang=="java")
                    {
                        var data=javalink.trim().split(/\s+/);
                    }

                    if(lang=="python3")
                    {
                        var data=pythonlink.trim().split(/\s+/);
                    }
                    var studentname= data[0];
                    var eventname = data[1].toUpperCase() +" Programming";
                    var dateevent = data[2].slice(0,10);
                    var filename = studentname+"_"+eventname;
                    var doc = new jsPDF('landscape','mm', 'a4');
                    doc.addImage(certi, 'JPEG', 0, 0, 297, 210,'','FAST');
                    doc.setFont('times')
                    
                    doc.setFontSize(56)
                    doc.text(95, 60,"Certificate");
                    doc.setFontSize(26)
                    doc.text(140, 80,"This is to certify that");
                    doc.setFontSize(46)
                    doc.text(150, 100,studentname);
                    doc.setFontSize(26)
                    doc.text(90, 120,"has successfully cleared the assessment for the skill");
                    doc.text(150, 135,eventname);
                    doc.setFontSize(16)
                    doc.text(230, 180,"Date : "+dateevent);
                    doc.save(filename+".pdf");
    }
    

     

  return (
    <div className='dashboardbody' style={{backgroundColor: "#011333"}}>

    <div className="container">
        <div className="Sidebar">
                <div className="about">
                <img src={profileImage}/>
                 <h2><p>{location.state.username}</p></h2>
                 <h6>Unique ID :</h6>
                 <p>{id}</p>
                 <hr/>
                <h3>About</h3>
                <h6>Email : </h6> 
                <p>{email}</p>
                <h6>Phone No : </h6>
                <p>{phoneno}</p>
                <h6>Bio : </h6>
                <p>{bio}</p>
                <h6>Type of Subscription : {subscription}</h6>
                <h6>Duration of Subscription : {duration} months</h6>
                <h6>Subscription Expires At : {end.substring(0,10)}</h6>
            </div>

        </div>

        <div className="Batches">
        <h3 className='badgehead' style={{float: 'left'}}><GiPoliceBadge style={{marginRight: 10}}/>Badges</h3>
        <div className='badgecontent'>
            <div className="hex">
                <div className="top">

                </div>

                <div className="middle">
                    <div className={parseInt(c, 10) >= 0&& parseInt(c, 10) < 5? "hexagonbronze" : "nohexagon"}>
                    <h6>C <br/>Programming</h6>
                    </div>
                    <div className={parseInt(c, 10) >= 5&& parseInt(c, 10) < 10 ? "hexagonsliver" : "nohexagon"}>
                    <h6>C <br/>Programming</h6>
                    </div>
                    <div className={parseInt(c, 10) >= 10 ? "hexagongold" : "nohexagon"}>
                    <h6>C <br/>Programming</h6>
                    </div>
                    
                    
                </div>

                <div className="bottom">
                    
                </div>
            </div>


            <div className="hex">
                <div className="top">

                </div>

                <div className="middle">
                    <div className={parseInt(cpp, 10) >= 0&& parseInt(cpp, 10) < 5? "hexagonbronze" : "nohexagon"}>
                    <h6>C++ <br/>Programming</h6>
                    </div>
                    <div className={parseInt(cpp, 10) >= 5&& parseInt(cpp, 10) < 10 ? "hexagonsliver" : "nohexagon"}>
                    <h6>C++ <br/>Programming</h6>
                    </div>
                    <div className={parseInt(cpp, 10) >= 10 ? "hexagongold" : "nohexagon"}>
                    <h6>C++ <br/>Programming</h6>
                    </div>     
                </div>

                <div className="bottom">
                    
                </div>
            </div>


            <div className="hex">
                <div className="top">

                </div>

                <div className="middle">
                    <div className={parseInt(java, 10) >= 0&& parseInt(java, 10) < 5? "hexagonbronze" : "nohexagon"}>
                    <h6>Java <br/>Programming</h6>
                    </div>
                    <div className={parseInt(java, 10) >= 5&& parseInt(java, 10) < 10 ? "hexagonsliver" : "nohexagon"}>
                    <h6>Java <br/>Programming</h6>
                    </div>
                    <div className={parseInt(java, 10) >= 10 ? "hexagongold" : "nohexagon"}>
                    <h6>Java <br/>Programming</h6>
                    </div>     
                </div>

                <div className="bottom">
                    
                </div>
            </div>


            <div className="hex">
                <div className="top">

                </div>

                <div className="middle">
                    <div className={parseInt(python, 10) >= 0&& parseInt(python, 10) < 5? "hexagonbronze" : "nohexagon"}>
                    <h6>Python<br/>Programming</h6>
                    </div>
                    <div className={parseInt(python, 10) >= 5&& parseInt(python, 10) < 10 ? "hexagonsliver" : "nohexagon"}>
                    <h6>Python <br/>Programming</h6>
                    </div>
                    <div className={parseInt(python, 10) >= 10 ? "hexagongold" : "nohexagon"}>
                    <h6>Python<br/>Programming</h6>
                    </div>     
                </div>

                <div className="bottom">
                    
                </div>
            </div>

        </div>
    </div>


    <div className="Certificates">
    <h3 className='certihead' style={{float: 'left'}}><TbCertificate style={{marginRight: 10}}/>Verified Skills</h3>
        <div className='certicontent'>
            <div className="hex">
                <div className="middle">
                <div className={ cCerti.length>0? "certi" : "nohexagon"}>
                        <h6>C Programming</h6>
                        <h6>Status : {cCerti}</h6>
                        <h6 style={cCerti=="pending"?{display:'none'}:{display:'block'}}  onClick={()=>{Approve("c")}}>link</h6>
                    </div>

                    <div className={ cppCerti.length>0? "certi" : "nohexagon"}>
                        <h6>C++ Programming</h6>
                        <h6>Status : {cppCerti}</h6>
                        <a style={cppCerti=="pending"?{display:'none'}:{display:'block'}} onClick={()=>{Approve("cpp")}}>link</a>
                    </div>

                    <div className={ javaCerti.length>0? "certi" : "nohexagon"}>
                        <h6>Java Programming</h6>
                        <h6>Status : {javaCerti}</h6>
                        <a style={javaCerti=="pending"?{display:'none'}:{display:'block'}} onClick={()=>{Approve("java")}}>link</a>
                    </div>

                    <div className={ pythonCerti.length>0? "certi" : "nohexagon"}>
                        <h6>Python Programming</h6>
                        <h6>Status : {pythonCerti}</h6>
                        <a style={pythonCerti=="pending"?{display:'none'}:{display:'block'}} onClick={()=>{Approve("python3")}}>link</a>
                    </div>
           
                    
                    
                </div>
            </div>
        </div>
    </div>


        

        
    
    </div>


    </div>
  )
}

export default Dashboard